import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Typography,
  Grid,
  Button,
  Paper,
  Chip
} from '@mui/material';
import productos from '../../data/productos.json';

export default function Comprar() {
  const navigate = useNavigate();
  const isLoggedIn = Boolean(localStorage.getItem('token'));

  const handleCompra = (id) => {
    if (!isLoggedIn) {
      navigate('/login');
    } else {
      navigate(`/comprar/${id}`);
    }
  };

  return (
    <Box>
      {/* Banner estilo Agripac */}
      <Box
        sx={{
          width: '100%',
          height: { xs: 280, md: 400 },
          backgroundImage: 'url("/imagenes/banner-nexgard.webp")',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          display: 'flex',
          alignItems: 'flex-end',
          justifyContent: 'flex-start',
          px: 4,
          py: 3
        }}
      >
        <Typography
          variant="h4"
          sx={{
            color: '#fff',
            fontWeight: 'bold',
            backgroundColor: 'rgba(0,0,0,0.4)',
            px: 3,
            py: 1,
            borderRadius: 2
          }}
        >
          NexGard Combo ¬∑ Protecci√≥n total para tus mascotas üê±
        </Typography>
      </Box>

      {/* Categor√≠as destacadas */}
      <Box sx={{ px: { xs: 2, md: 4 }, py: 4 }}>
        <Typography variant="h5" sx={{ fontWeight: 'bold', mb: 3 }}>
          Explor√° por categor√≠a
        </Typography>
        <Grid container spacing={3}>
          {['Jardiner√≠a', 'Perros', 'Gatos', 'Limpieza'].map((cat, idx) => (
            <Grid item xs={6} sm={3} key={idx}>
              <Paper
                elevation={2}
                sx={{
                  p: 2,
                  textAlign: 'center',
                  borderRadius: 3,
                  cursor: 'pointer',
                  '&:hover': { boxShadow: 4 }
                }}
              >
                <img
                  src={`/imagenes/categorias/${cat.toLowerCase()}.webp`}
                  alt={cat}
                  style={{ width: '100%', borderRadius: 8 }}
                />
                <Typography sx={{ mt: 1, fontWeight: 'bold' }}>
                  {cat}
                </Typography>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Box>

      {/* Cat√°logo de productos */}
      <Box sx={{ px: { xs: 2, md: 4 }, pb: 6 }}>
        <Typography variant="h5" sx={{ fontWeight: 'bold', mb: 3 }}>
          Productos destacados
        </Typography>
        <Grid container spacing={4}>
          {productos.map((prod) => (
            <Grid item xs={12} sm={6} md={4} key={prod.id}>
              <Paper elevation={3} sx={{ p: 2, borderRadius: 3, position: 'relative' }}>
                <img
                  src={prod.imagen}
                  alt={prod.nombre}
                  style={{
                    width: '100%',
                    borderRadius: 8,
                    objectFit: 'cover'
                  }}
                />
                <Typography variant="h6" sx={{ mt: 2, fontWeight: 'bold' }}>
                  {prod.nombre}
                </Typography>
                <Typography variant="body2" sx={{ color: 'text.secondary', mb: 1 }}>
                  Precio: {prod.precio} USD
                </Typography>
                {prod.descuento && (
                  <Chip
                    label={`-${prod.descuento}%`}
                    color="error"
                    size="small"
                    sx={{ position: 'absolute', top: 10, right: 10 }}
                  />
                )}
                <Button
                  variant="contained"
                  color="success"
                  fullWidth
                  onClick={() => handleCompra(prod.id)}
                  sx={{
                    borderRadius: 30,
                    py: { xs: 1, md: 1.5 },
                    fontWeight: 'bold',
                    fontSize: { xs: '0.9rem', md: '1rem' },
                    mt: 2
                  }}
                >
                  Comprar
                </Button>
                {!isLoggedIn && (
                  <Typography
                    variant="body2"
                    sx={{
                      mt: 1,
                      color: 'error.main',
                      textAlign: 'center',
                      fontSize: { xs: '0.8rem', md: '0.9rem' }
                    }}
                  >
                    Debes iniciar sesi√≥n o registrarte para comprar üîê
                  </Typography>
                )}
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Box>
    </Box>
  );
}
